const y_factor = 9;
const x_factor = 16;
const dimensionFactor = Math.floor(visualViewport.height/ y_factor);
const width = dimensionFactor * x_factor;
const height = dimensionFactor * y_factor;

const canvas = document.getElementById('mycanvas');
canvas.width = width;
canvas.height = height;
const ctx = canvas.getContext('2d');

const myImage = new Image;
myImage.src = 'data:image/jpeg;base64,'


ctx.drawImage(myImage, 0, 0, width, height)

function formData() {
    const scannedCanvasData = ctx.getImageData(0, 0, width, height).data;
    ctx.clearRect(0, 0, width, height);
    const mappedData = [];
    const getRelativeBrightness = function(red, green, blue) {
        return Math.sqrt(
            (red * red) * 0.299 +
            (green * green) * 0.587 +
            (blue * blue) * 0.114
        )/255;
    }
    for (let y = 0; y < height; y++){
        const row = [];
        for (let x = 0; x < width; x++) {
            const red = scannedCanvasData[4 * y * width +  4 * x];
            const green = scannedCanvasData[4 * y * width + 4 * x + 1];
            const blue = scannedCanvasData[4 * y * width + 4 * x + 2];

            const pixelData = {
                color: `rgb(${red}, ${green}, ${blue})`,
                brightness: getRelativeBrightness(red, green, blue)
            }
    
            row.push(pixelData);
        }
        mappedData.push(row);
    }

    return mappedData;
}
const mappedData = formData();




const numOfParticles = 10000;
const particleArray = [];

class Particle {
    constructor() {
        this.x = 0;
        this.y = Math.random() * height;
        this.positionData = mappedData[Math.floor(this.y)][Math.floor(this.x)];
        this.brightness = this.positionData.brightness;
        this.color = this.positionData.color;
        this.size = (1 - this.brightness) * 4.5;
        
        this.baseSpeed = Math.random() * 2 + 0.5
        this.vv1Magnitude = 2 * (1 - this.brightness);
        this.vv1Angle = Math.PI/6;

        this.angle = 0
        
    }
    update () {
 
        this.x += (this.vv1Magnitude + this.baseSpeed) * Math.cos(this.vv1Angle) + 4 * Math.cos(this.angle)
        this.y += (this.vv1Magnitude + this.baseSpeed) * Math.sin(this.vv1Angle) + 4 * Math.sin(this.angle)


        if ( this.x >= width ) {
            this.x = 0;
        } else if ( this.x < 0 ) {
            this.x = width - 1;
        }
        if ( this.y >= height ) {
            this.y = 0;
        } else if ( this.y < 0 ) {
            this.y = height - 1;
        }
        
        
        this.positionData = mappedData[Math.floor(this.y)][Math.floor(this.x)];
        this.brightness = this.positionData.brightness;
        this.color = this.positionData.color;
        
        this.size = (1 - this.brightness) * 2.5;
        this.vv1Magnitude = 10 * (1 - this.brightness);
        this.angle += .5 * this.brightness
    }

    draw () {
        ctx.fillStyle = this.color;
        ctx.beginPath()
        ctx.arc(this.x, this.y, this.size, 0, 2 * Math.PI);
        ctx.fill();
    }
}

function initParticleArray() {
    for (let i = 0; i < numOfParticles; i++) {
        particleArray.push(new Particle);
    }
}

function animate() {
    ctx.globalAlpha = 0.05;
    ctx.fillStyle = 'black';
    ctx.fillRect(0, 0, width, height);


    for (let i = 0; i < numOfParticles; i++) {
        ctx.globalAlpha = particleArray[i].brightness * 1;
        particleArray[i].draw();
        particleArray[i].update();
    }

    requestAnimationFrame(animate)
}

initParticleArray();
requestAnimationFrame(animate);